end;

procedure pickcoin;
begin
if(findcolorspiraltolerance(x,y,coincolor,MSX1,MSY1,MSX2,MSY2,25))then
Mmouse(x,y,3,3)
if(IsUpTextMulti('take','coins','ke co'))then
begin
Writeln('found coins,now going to pick them up');
mouse(x,y,0,0,true)
Findnormalrandoms;
coins:=coins+1
end;
end;

procedure hatetherandoms;
begin
FindNormalRandoms;
   if (FindTalk) then
   begin
   Writeln('talking or found a talk');
   randomfound:=randomfound+1

   if (FindMime) then
   begin
   writeln('lucky you, a mime!');
   randomfound:=randomfound+1

   if (FindMaze) then
   begin
   writeln('found maze');
   randomfound:=randomfound+1

   if (SolveFrog) then
   begin
   writeln('solved frog');
   randomfound:=randomfound+1

   if (Findmod)then
   begin
   writeln('its the mod!,AHHH!');
   mods:=mods+1

   if (solvepinball)then
   begin
   writeln('solved a pinball...');
   randomfound:=randomfound+1

   if (findforester) then
   begin
   writeln('found forester');
   randomfound:=randomfound+1

   if(findscaperune)then
   begin
   createscaperune;
   writeln('found scape rune');
   randomfound:=randomfound+1
end;
end;
end;
end;
end;
end;
end;
end;
end;

procedure MortalDraw;
begin
hatetherandoms;
findnormalrandoms;
realeatifneeded(foodcolor1,hpeat,true)
if findmonster(monstercolor1,monstercolor2,monstercolor3,25,mname)then
mmouse(x,y,3,3)
Attackmonster(monstercolor1,monstercolor2,monstercolor3,mname,25)
    Begin
    Getmousepos(x,y)
  Mouse(x,y,0,0,True);
  RandomMovement;
  boredhuman;
  killed:=killed+1
  wait2(Timebetweenkill,true)
  pickcoin;
end;
end;

procedure pickpickarrow;
begin
if(fightstyle=('arrow'))then
begin
MortalDraw;
if(findcolorspiraltolerance(x,y,arrowcolor,msx1,msy1,msx2,msy2,25))then
mmouse(x,y,3,3)
if(IsUpTextMulti('take','arrows',kindarrow))then
getmousepos(x,y)
mouse(x,y,1,1,true)
arrowspickedup:=arrowspickedup+1
end;
end;

