Writeln('Collected around ' + inttostr(bonesfound));
Writeln('burried around ' + inttostr(bonesburried));
Writeln('picked up ' + inttostr(coins) + 'group of coins');
Writeln('casted ' + inttostr(spellscasted) + 'spells');
